from PbxTeam.modules.bad.data import  GROUP, PORM



GC = 1

@app.on_message(cdz(["spam"])  & (filters.me | filters.user(SUDO_USER))
)
async def spam(client: Client, message: Message):
    alt = message.text.split(" ", 2)
    if  len(alt) == 3:
        quantity, spam_text = int(alt[1]), alt[2]
        if message.reply_to_message:
            id = message.reply_to_message_id
            for _ in range(quantity):
                await message.reply_text(spam_text, reply_to_message_id=id)
                await asyncio.sleep(0.3)
        else:
            cid = message.chat.id
            for _ in range(quantity):
                await spam.send_message(cid, spam_text)
                await asyncio.sleep(0.3)

    elif message.reply_to_message:
        spam_text = message.reply_to_message.text
        quantity = int(alt[1])
        cid = message.chat.id
        for _ in range(quantity):
            await xspam.send_message(cid, spam_text)
            await asyncio.sleep(0.3)

    else:
        await message.reply_text(f"😈 **ᴜsᴀɢᴇ:**\n\n» .spam 13 Bad my dad\n» .spam 13 <ʀᴇᴘʟʏ ᴛᴏ ᴛᴇxᴛ>\n\n**To do spam with replying to a user:**\n» .spam 13 bad my dad<ʀᴇᴘʟʏ ᴛᴏ ᴜꜱᴇʀ>")


@app.on_message(cdz(["porn"])  & (filters.me | filters.user(SUDO_USER))
)
async def pspam(xspam: Client, message: Message):
    cid = message.chat.id
    if int(cid) in GROUP:
        await message.reply_text("» ꜱᴏʀʀʏ, ᴛʜɪꜱ ɪꜱ ᴀʟᴛʀᴏɴ ᴘʀᴏᴛᴇᴄᴛᴇᴅ ɢʀᴏᴜᴘ !")
        return

    altp = message.text.split(" ", 2)
    if len(altp) > 1:
        quantity = int(altp[1])
        for _ in range(quantity):
            porm = choice(PORM)
            await xspam.send_video(cid, porm)
            await asyncio.sleep(0.3)
    else:
        await message.reply_text(f"🔞 **ᴜsᴀɢᴇ:**  .pspam 13")


